import React from "react";

const CardProtfolio = (props) => {
  const { img, title } = props;
  return (
    <>
      <div className="box btn_shadow">
        <div className="img">
          <img src={img} alt="" />
          <h1>hello</h1>
        </div>

        <div className="title">
          <h2>{title}</h2>
          <a href="#popup" className="arrow">
            <i className="fas fa-arrow"></i>
          </a>
        </div>
      </div>
    </>
  );
};

export default CardProtfolio;
